import { Fragment, useEffect } from "react";
import "../UserProfile/UserProfile.css"
import { useNavigate } from 'react-router-dom'
import USERController from "../../controllers/USER-controller";
import masterController from "../../controllers/MASTER-controller";

const UserProfile = () => {

    const navigate = useNavigate();
    const [image, setImage] = useState(null);

    const logout = async () => {
        if(await USERController.logOutUser()){
            navigate('/');
        }
    }

    useEffect(async ()=>{
        setImage(await masterController.getMasterPhotoById(5, "images\\mastersPhoto\\6\\unnamed1.jpg"));
    },[navigate]);

    return(<Fragment>
            <div className="user-profile">
                <div className='profile-wrapper'>
                    <div className='navigation-profile-wrapper'>
                        <button onClick={e => logout()} className='button-grey'>logOut</button>
                    </div>
                    <div className='profile-info'>
                        <div>
                            <img src={image}></img>
                        </div>
                    </div>
                </div>
            </div>
        </Fragment>);
};

export default UserProfile;
